            <SView col={"xs-9"} height border={'blue'} center  >

            </SView>
        </SView>

    }

    render() {
        return (
            <SPage title={''} hidden disableScroll height >
                <SView col={"xs-12"} center height backgroundColor={'transparent'}>
                    <SView col={"xs-11"} flex height backgroundColor={'transparent'}  >


