                        <SView col={"xs-12"} center row height  >

                            {this.getExperiencia()}
                        </SView>



                    </SView>
                    <SView col={"xs-11"} flex height backgroundColor={'red'} center>
                        <SText style={{ fontSize: 50 }} >proyecto</SText>
                    </SView>
                </SView>
            </SPage >
        );
    }
}
const initStates = (state) => {
    return { state }
};
export default connect(initStates)(root);
